import Link from "next/link";

const About = () => {
  return (
    <div>
      <p>I am learning about Next.js</p>
      <Link href="/index">
        <a>Home</a>
      </Link>{" "}
      <Link href="/about">
        <a>About</a>
      </Link>
    </div>
  );
};

export default About;
